import React from "react";

const Card = ({dog}) => {
    return (
			<>
				<div className='card'>
					<div>
						<img src={dog.image} alt='dog' />
						<p>{dog.breed.name}</p>
					</div>
					<div>
                        <p>Breed: {breed.name}</p>
                    </div>
				</div>
			</>
		);
}

export default Card;
